import React from 'react';
import Form from "../components/Form"

const formStyle = {
    // margin: 'auto',
    padding: '30px',
    border: '1px solid #c9c9c9',
    borderRadius: '5px',
    background: '#f5f5f5',
    width: '400px',
    display: 'block',
    minHeight : '300px',
    display: "flex",
    alignItems: "center",
    justifyContent: "center"
};

class Login extends React.Component {

    render() {
        return (
            <div style={formStyle}><label style={{backgroundColor : "green" , padding :"20px" , borderRadius : "8px" , color:"white"}} for="cheese">Successfully registered!</label>
            <label>Successfully registered!</label>
            </div>
        )
    }
}

export default Login
